import React, { useState, useEffect } from 'react';
import { Button, message } from 'antd';

export default function IndexPage() {
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => {
      setIsVisible(true);
    }, 100);
    return () => clearTimeout(timer);
  }, []);

  const openWindowsQQ = () => {
    try {
      window.location.href = 'tencent://';
      message.success(' Windows  QQ...');
    } catch (error) {
      message.error(' Windows  QQ');
      console.error('QQ', error);
    }
  };

  return (
    <div
      style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        minHeight: '100vh',
        padding: '20px',
        opacity: isVisible ? 1 : 0,
        transform: isVisible ? 'translateY(0)' : 'translateY(20px)',
        transition: 'opacity 1.5s ease-out, transform 1.5s ease-out',
      }}
    >
      <h1> Umi + React!</h1>
      <p style={{ margin: '16px 0' }}> Windows  QQ</p>
      {/*  */}
      <div style={{
        gap: '8px',
        display: 'flex',
        width: '320px' // +
      }}>
        {/*  */}
        <Button
          type="primary"
          size="large"
          onClick={openWindowsQQ}
          style={{ width: '156px' }} // 156*2 + 8= 320
        >
           Windows  QQ
        </Button>
        <Button
          type="primary"
          size="large"
          style={{ width: '156px' }} // 
        >

        </Button>
      </div>
    </div>
  );
}
